import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        return(
                <footer className="row">
                    <a className="icon col-md-4">
                        <div>
                            <i id="linkedin-icon" className="social-icon"/>
                        </div>
                    </a>
                    <a className="icon col-md-4">
                        <div>
                            <i id="github-icon" className="social-icon"/>
                        </div>
                    </a>
                    <a className="icon col-md-4">
                        <div>
                            <i id="whatsapp-icon" className="social-icon"/>
                        </div>
                    </a>
                </footer>
        )
    }
}

export default Footer;
